import { Link } from 'react-router-dom';

const ProductsPage = (props) => {
    return (
        <>
            <h1>The Product Page</h1>
            <ul>
                <li><Link to="/products/prodcut-1">Product 1</Link></li>
                <li><Link to="/products/prodcut-2">Product 2</Link></li>
                <li><Link to="/products/prodcut-3">Product 3</Link></li>
            </ul>
        </>

    )
}

export default ProductsPage;
